from collections import defaultdict


class Tasks:
    """
    Task 1:
        Implement the Pseudo Code download the text, pattern, and solve it within a given time frame:
            PatternCount(Text, Pattern)
              count ← 0
              for i ← 0 to |Text| − |Pattern|
                if Text(i, |Pattern|) = Pattern
                  count ← count + 1
              return count
    """

    @staticmethod
    def pattern_count(text: str, pattern: str) -> int:
        count: int = 0
        for i in range(len(text) - len(pattern) + 1):
            if text[i : i + len(pattern)] == pattern:
                count += 1
        return count

    """
        Task 2:
            Study this Pseudo Code:
                FrequentWords(Text, k)
                    FrequentPatterns ← an empty set
                    for i ← 0 to |Text| − k
                        Pattern ← the k-mer Text(i, k)
                        Count(i) ← PatternCount(Text, Pattern)
                    maxCount ← maximum value in array Count
                    for i ← 0 to |Text| − k
                        if Count(i) = maxCount
                            add Text(i, k) to FrequentPatterns
                    remove duplicates from FrequentPatterns
                    return FrequentPatterns
        Q1: How fast is this algorithm?
            Outer loop = n - k + 1
            Pattern counting = O(n)
            Overall loop = O((n - k + 1) * n) -> O(n^2)   
    """

    def frequent_words(self, text: str, k: int) -> set[str]:
        frequent_patterns: set[str] = set()
        count: list[int] = []

        for i in range(len(text) - k + 1):
            pattern = text[i : i + k]
            count.append(self.pattern_count(text, pattern))
        max_count = max(count)
        for i in range(len(text) - k + 1):
            if count[i] == max_count:
                frequent_patterns.add(text[i : i + k])

        return frequent_patterns

    """
        Task 3:
        FrequencyTable(Text, k)
            freqMap ← empty map
            n ← |Text|
            for i ← 0 to n − k
                Pattern ← Text(i, k)
                if freqMap[Pattern] doesn't exist
                    freqMap[Pattern]← 1
                else
                   freqMap[pattern] ←freqMap[pattern]+1 
            return freqMap
    """

    @staticmethod
    def frequency_table(text: str, k: int) -> dict[str, int]:
        freq_map = {}
        n = len(text)

        for i in range(n - k + 1):
            pattern = text[i : i + k]
            if pattern not in freq_map:
                freq_map[pattern] = 1
            else:
                freq_map[pattern] += 1

        return freq_map

    """
        Task 4: 
        BetterFrequentWords(Text, k)
            FrequentPatterns ← an array of strings of length 0
            freqMap ← FrequencyTable(Text, k)
            max ← MaxMap(freqMap)
            for all strings Pattern in freqMap
                if freqMap[pattern] = max
                    append Pattern to frequentPatterns
            return frequentPatterns           
        Q1. Can you write the function MaxMap?      
    """

    @staticmethod
    def max_map(freq_map: dict[str, int]) -> int:
        max_val = max(freq_map.values())
        return max_val

    def better_frequent_words(self, text: str, k: int) -> list[str]:
        frequent_patterns: list[str] = []
        freq_map: dict[str, int] = self.frequency_table(text, k)
        max_value: int = self.max_map(freq_map)
        for pattern, count in freq_map.items():
            if count == max_value:
                frequent_patterns.append(pattern)
        return frequent_patterns

    """
        Task 5:
        Given a nucleotide p, we denote its complementary nucleotide as p*. The reverse complement of a string Pattern = p1 … pn is the string Patternrc = pn* … p1* formed by taking the complement of each nucleotide in Pattern, then reversing the resulting string. 
    """

    @staticmethod
    def reverse_complement(pattern: str) -> str:
        complement = {"A": "T", "T": "A", "C": "G", "G": "C"}
        complement_pattern = "".join(complement[nucleotide] for nucleotide in pattern)
        reverse_complement_pattern = complement_pattern[::-1]
        return reverse_complement_pattern

    """
        Task 6:
        Pattern matching 
    """

    @staticmethod
    def pattern_matching(pattern: str, genome: str) -> list[int]:
        positions = []
        pattern_length = len(pattern)
        genome_length = len(genome)

        for i in range(genome_length - pattern_length + 1):
            if genome[i : i + pattern_length] == pattern:
                positions.append(i)

        return positions

    """
        Task 7:
        Clump Finding Problem: Find patterns forming clumps in a string.
        Input: A string Genome, and integers k, L, and t.
        Output: All distinct k-mers forming (L, t)-clumps in Genome.
        
        FindClumps(Text, k, L, t)
            Patterns ← an array of strings of length 0
            n ← |Text|
            for every integer i between 0 and n − L
                Window ← Text(i, L)
                freqMap ← FrequencyTable(Window, k)
                for every key s in freqMap
                    if freqMap[s] ≥ t
                        append s to Patterns
            remove duplicates from Patterns
            return Patterns
    """

    @staticmethod
    def find_clumps(genome: str, k: int, l: int, t: int) -> set[str]:
        clumps: set[str] = set()
        n = len(genome)

        for i in range(n - l + 1):
            window = genome[i : i + l]
            kmer_count: defaultdict[str, int] = defaultdict(int)

            for j in range(l - k + 1):
                kmer = window[j : j + k]
                kmer_count[kmer] += 1

            for kmer, count in kmer_count.items():
                if count >= t:
                    clumps.add(kmer)

        return clumps


